import React from 'react'
import Product from './Product'
import {useEndpoint} from '../useEndpoint'


export default function StoreContainer() {
    let [data] = useEndpoint();
    console.log(data)

    return(
        <div className='grid'>    
            {data?.map((product, i)=>{
                return(
                    <Product 
                        key={i}
                        name={product.name}
                        price={product.price}
                        rating={product.rating}
                        image={product.image_link}
                    />
                )
            })}
        </div> 
    )
}
